import React from "react";

const HiddenSingleComponent = (props) => {
  return <h2>naked single</h2>;
};

export const hiddenSingle = {
  name: "Hidden Single",
  check: (cell) => {
    if (cell.suspects.size === 1) {
      return cell.suspects.values().next().value;
    }
    return 0;
  },
};
